import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const servOneData = [
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
]

const ServiceOneMiddle = () => {
    return (
        <View style={styles.l_middle}>
            <View style={styles.l_miidle_box}>
                {servOneData.map((data) => (
                    <View style={styles.box_one}>
                        <Image source={data.img} style={styles.l_m_img} />
                        <Text style={styles.hairStyles}>{data.tite}</Text>
                    </View>
                ))}
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    l_middle: {
        width: '100vw',
        minHeight: "200px",
        left: 0,
        top: 115,
        backgroundColor: "#fff",
        display: 'inline-block',
        backgroundColor: "#fff"
    },
    l_miidle_box: {
        width: '95vw',
        height: '180px',
        left: '0',
        top: 8,
        backgroundColor: "#fff",
        margin: 'auto',
        flexDirection: 'row',
        flexDirection: 'space-between'
    },
    box_one: {
        position: 'absolute',
        width: '125px',
        height: '159px',
        backgroundColor: "#175C4C",
        left: 3,
        top: 0,
        margin: 'auto',
        borderRadius: '20px',
        padding: '10px',
    },
    l_m_img: {
        position: 'absolute',
        width: 109,
        height: 116,
        left: 8,
        top: 5,
        fontSize: '28px',
        padding: '10px',
    },
    hairStyles: {
        position: 'absolute',
        width: 102,
        height: 18,
        left: 12,
        top: 133,
        fontSize: 12,
        lineHeight: '16px',
        letterSpacing: '2%',
        fontWeight: '700',
        color: "#fff",
    },
    l_m_textStyle: {
